var box = scene.getObjectByName( 'Cylinder 1' );
box.geometry.rotateX( Math.PI / 2 );

var group = new THREE.Group();
scene.add( group );

var amount = 100;

for ( var i = 0; i < amount; i ++ ) {

	var j = ( i / amount ) * Math.PI * 2;

	var clone = box.clone();
	clone.material = box.material.clone();
	group.add( clone );

}

var position = new THREE.Vector3();

function update( event ) {

	var time = event.time / 1000;

	for ( var i = 0; i < amount; i ++ ) {

		var j = ( i / amount ) * Math.PI * 2;

		var value = Math.sin( time * 1.567 + ( i / 16.0 ) ) +
			Math.sin( time * 1.345 + ( i / 8.0 ) ) +
			Math.sin( time * 1.456 + ( i / 4.0 ) );

		value *= Math.sin( time * 0.123 );

		var object = group.children[ i ];
		object.position.x = Math.cos( j ) * ( 2 + ( value / 4 ) );
		object.position.y = Math.sin( j ) * ( 2 + ( value / 4 ) );
		object.position.z = value / 5.0;
		object.material.emissive.g = Math.pow( value, 6.0 ) / 50.0;
		object.material.emissive.b = Math.pow( value, 2.0 ) / 10.0;
		object.lookAt( position );

		position = object.position;

	}

	scene.rotation.x = time / 9.0;
	scene.rotation.y = time / 8.0;

}
